eval("module.exports = \"## 新功能与重大调整\\r\\n\\r\\n**综合**\\r\\n\\r\\n* UI重新设计，导航现已移动到左侧\\r\\n* 新增英语、日语版本，可在左侧导航（手机设备为左侧菜单）中进行切换\\r\\n\\r\\n**舰娘列表**\\r\\n\\r\\n* 现可按分类进行标签页切换\\r\\n* 优化舰种分类和顺序\\r\\n* 驱逐舰现在会按舰级分类\\r\\n* 移除属性表格视图\\r\\n* 属性对比现需要通过右上角的按钮开启\\r\\n* 手机等小屏幕设备现在可以在属性对比中看到所有属性了\\r\\n* 非日本帝国海军的舰娘现在会在头像上显示所属军籍的旗帜\\r\\n\\r\\n**舰娘详情**\\r\\n\\r\\n* 新的设计\\r\\n* 新的信息：所属军籍、解体获得资源\\r\\n* 可通过设置等级查询任意等级的属性\\r\\n* 特殊图鉴现在会提供标题说明\\r\\n* 新增标签页：作战能力，内容包括：\\r\\n  * 特殊能力\\r\\n  * AACI组合\\r\\n  * 航速提升计算器\\r\\n  * 先制对潜攻击计算器\\r\\n* 新增标签页：可装备\\r\\n  * 可查询该舰娘可配置的装备类型信息\\r\\n\\r\\n**装备详情**\\r\\n\\r\\n* 新的设计\\r\\n* 新的属性：TP (当存在时)\\r\\n\\r\\n**改修工厂**\\r\\n\\r\\n* 新的设计\\r\\n\\r\\n## TODOs\\r\\n\\r\\n**以下模块仍在开发中**\\r\\n\\r\\n* 页面\\r\\n  * 首页\\r\\n  * 舰队模拟\\r\\n  * TP计算\\r\\n  * 关于\\r\\n* 框架\\r\\n  * 导航\\r\\n    * 语言切换\\r\\n    * 背景图视图入口\\r\\n  * 背景图视图\\r\\n    * UI优化\\r\\n    * 原图下载\\r\\n    * 上传自定义图片\\r\\n  * 手机等小屏幕\\r\\n    * 视觉提示：页面读取中\\r\\n\\r\\n**对原有版本计划的改动**\\r\\n\\r\\n* 舰队模拟\\r\\n  * UI重做\\r\\n    * 补强增设栏位更易读\\r\\n    * 加入更多数据计算（AACI、对潜等）\\r\\n    * 配装快捷查询（AACI、夜战等）\\r\\n  * 列表支持文件夹\\r\\n  * 开放配置导入接口，提供完整支持文档\\r\\n\\r\\n## 长远计划\\r\\n\\r\\n* 云端存储数据\\r\\n* 舰娘详情\\r\\n  * 新增标签页：台词 & 语音\\r\\n  * 新增标签页：获取方式\\r\\n* 装备详情\\r\\n  * 新增数据（或标签页？）：获取方式\\r\\n* 改修工厂\\r\\n  * 每日改修页新增按改修资财数量过滤\\r\\n* 新增页面：远征\\r\\n* 新增页面：出击海域\\r\\n* 新增页面：点唱机\\r\\n\"\n\n//# sourceURL=webpack:///./docs/updates/1.0.0/zh.md?");

